import{_ as e,c as a,a3 as n,o as l}from"./chunks/framework.DtMx7FFi.js";const i="/assets/ampChart.DnL-0EnD.png",s="data:image/webp;base64,",r="data:image/webp;base64,",o="data:image/webp;base64,",u=JSON.parse('{"title":"Recommended Amps","description":"","frontmatter":{},"headers":[],"relativePath":"information/amps.md","filePath":"information/amps.md"}'),d={name:"information/amps.md"};function c(h,t,g,A,x,p){return l(),a("div",null,t[0]||(t[0]=[n('<h1 id="recommended-amps" tabindex="-1">Recommended Amps <a class="header-anchor" href="#recommended-amps" aria-label="Permalink to &quot;Recommended Amps&quot;">​</a></h1><p>This section of the guide will explain the recommended amps that are very effective in one-shotting Thrax.</p><h2 id="amp-chart" tabindex="-1"><strong>Amp Chart</strong> <a class="header-anchor" href="#amp-chart" aria-label="Permalink to &quot;**Amp Chart**&quot;">​</a></h2><p>Before explaining the optimal amps for one-shotting, here is a chart of the stats that each part of the amp give. <strong>Chart credit:</strong> <a href="https://www.reddit.com/r/Warframe/comments/16f45rf/update_i_made_myself_an_even_nicer_amp_chart/" target="_blank" rel="noreferrer">u/SmallCranberry9376</a>.</p><div style="display:flex;"><img src="'+i+'" alt="Amp Chart"></div><h2 id="prisms" tabindex="-1"><strong>Prisms</strong> <a class="header-anchor" href="#prisms" aria-label="Permalink to &quot;**Prisms**&quot;">​</a></h2><p>The precise rifle/sniper Prisms - Raplak, Cantic, Rahn - are very effective with headshots, but these require relatively good aim/accuracy from the player. The flamethrower Klamora Prism has a large hitbox so is more forgiving, but it still requires headshots for a decent TTK at level cap.</p><h2 id="scaffolds" tabindex="-1"><strong>Scaffolds</strong> <a class="header-anchor" href="#scaffolds" aria-label="Permalink to &quot;**Scaffolds**&quot;">​</a></h2><p>The Phahd Scaffold does decent damage against Thrax Spectrals, and is notoriously good for self-reviving with Last Gasp due to the bouncing glaives providing multiple instances of damage per shot (especially effective when they get caught inside a Void bubble and repeatedly bounce on the same target). The Propa Scaffold can be timed to detonate at the end of a Thrax&#39;s Spectral animation, but its short range, inability to headshot, harsh falloff, and self knockback, can make it an inconvenient and not very effective choice.</p><h2 id="braces" tabindex="-1"><strong>Braces</strong> <a class="header-anchor" href="#braces" aria-label="Permalink to &quot;**Braces**&quot;">​</a></h2><p>For the best possible damage output, the Certus Brace is almost mandatory due to providing the best flat critical chance. When it comes to killing Spectral Thrax in short bursts of high damage, the other Braces don&#39;t offer helpful bonuses.</p><h2 id="comparison" tabindex="-1"><strong>Comparison</strong> <a class="header-anchor" href="#comparison" aria-label="Permalink to &quot;**Comparison**&quot;">​</a></h2><p>A level 9999 Spectral Thrax Centurion has approximately 4,000,000 health. The damage output of various Amp parts across various Focus Schools is laid out below, to give you an idea of what your TTK will look like:</p><div class="tip custom-block"><p class="custom-block-title">Attention:</p><p>Please read the focus school notes as it explains in general the information of each school abilities.</p></div><div style="display:flex;justify-content:center;align-items:center;"><img src="'+s+'" alt="prism"></div><div style="text-align:center;"><br><b>RAPLAK PRISM x Certus Brace<br> 58% base CC -- 162% CC with Onslaught active -- 2.6x Critical Multiplier</b></div><div class="table-1"><table tabindex="0"><thead><tr><th style="text-align:center;"><strong>EO &amp; EE</strong></th><th style="text-align:center;"><strong>Madurai</strong></th><th style="text-align:center;"><strong>Madurai</strong></th><th style="text-align:center;"><strong>Unairu</strong></th><th style="text-align:center;"><strong>Zenurik</strong></th><th style="text-align:center;"><strong>Naramon</strong></th><th style="text-align:center;"><strong>Vazarin</strong></th></tr></thead><tbody><tr><td style="text-align:center;">Focus School Damage Buff</td><td style="text-align:center;">Contamination Wave</td><td style="text-align:center;">Void Strike</td><td style="text-align:center;">Caustic Strike &amp; Unairu Wisp</td><td style="text-align:center;">NOTES</td><td style="text-align:center;">Amp Spike</td><td style="text-align:center;">N/A</td></tr><tr><td style="text-align:center;">Orange Headshot</td><td style="text-align:center;">8,628,081</td><td style="text-align:center;">32,505,792</td><td style="text-align:center;">3,620,032</td><td style="text-align:center;">2,349,846</td><td style="text-align:center;">3,620,032</td><td style="text-align:center;">2,349,846</td></tr><tr><td style="text-align:center;">Yellow Headshot</td><td style="text-align:center;">4,531,728</td><td style="text-align:center;">17,073,021</td><td style="text-align:center;">2,002,392</td><td style="text-align:center;">1,299,798</td><td style="text-align:center;">2,002,392</td><td style="text-align:center;">1,299,798</td></tr></tbody></table></div><div class="info custom-block"><p class="custom-block-title"><strong>Raplak Notes:</strong></p><p>Hit-scan, single shot, long range</p></div><div style="display:flex;justify-content:center;align-items:center;"><img src="'+r+'" alt="prism 1"></div><div style="text-align:center;"><br><b>RAPLAK PRISM x Certus Brace<br> 54% base CC -- 151% CC with Onslaught active -- 2.2x Critical Multiplier</b></div><div class="table-1"><table tabindex="0"><thead><tr><th style="text-align:center;"><strong>EO &amp; EE</strong></th><th style="text-align:center;"><strong>Madurai</strong></th><th style="text-align:center;"><strong>Madurai</strong></th><th style="text-align:center;"><strong>Unairu</strong></th><th style="text-align:center;"><strong>Zenurik</strong></th><th style="text-align:center;"><strong>Naramon</strong></th><th style="text-align:center;"><strong>Vazarin</strong></th></tr></thead><tbody><tr><td style="text-align:center;">Focus School Damage Buff</td><td style="text-align:center;">Contamination Wave</td><td style="text-align:center;">Void Strike</td><td style="text-align:center;">Caustic Strike &amp; Unairu Wisp</td><td style="text-align:center;">NOTES</td><td style="text-align:center;">Amp Spike</td><td style="text-align:center;">N/A</td></tr><tr><td style="text-align:center;">Orange Headshot</td><td style="text-align:center;">3,523,459(3x = 10,570,377)</td><td style="text-align:center;">13,274,427 (3x = 39,823,281)</td><td style="text-align:center;">1,463,254 (3x = 4,389,762)</td><td style="text-align:center;">949,831 (3x = 2,849,493)</td><td style="text-align:center;">1,463,254 (3x = 4,389,762)</td><td style="text-align:center;">949,831 (3x = 2,849,493)</td></tr><tr><td style="text-align:center;">Yellow Headshot</td><td style="text-align:center;">1,867,671 (3x = 5,603,013)</td><td style="text-align:center;">7,036,341 (3x = 21,109,023)</td><td style="text-align:center;">825,250 (3x = 2,475,750)</td><td style="text-align:center;">535,689 (3x = 1,607,067)</td><td style="text-align:center;">825,250 (3x = 2,475,750)</td><td style="text-align:center;">535,689 (3x = 1,607,067)</td></tr></tbody></table></div><div class="info custom-block"><p class="custom-block-title"><strong>Cantic Notes:</strong></p><p>Hit-scan, 3-shot burst, medium range. Each hit rolls its own crit chance - will get a mixture of yellow and orange crits with each burst</p></div><div style="display:flex;justify-content:center;align-items:center;"><img src="'+o+'" alt="prism 1"></div><div style="text-align:center;"><br><b>RAHN PRISM x Certus Brace<br> 50% base CC -- 140% CC with Onslaught active -- 2x Critical Multiplier</b></div><div class="table-1"><table tabindex="0"><thead><tr><th style="text-align:center;"><strong>EO &amp; EE</strong></th><th style="text-align:center;"><strong>Madurai</strong></th><th style="text-align:center;"><strong>Madurai</strong></th><th style="text-align:center;"><strong>Unairu</strong></th><th style="text-align:center;"><strong>Zenurik</strong></th><th style="text-align:center;"><strong>Naramon</strong></th><th style="text-align:center;"><strong>Vazarin</strong></th></tr></thead><tbody><tr><td style="text-align:center;">Focus School Damage Buff</td><td style="text-align:center;">Contamination Wave</td><td style="text-align:center;">Void Strike</td><td style="text-align:center;">Caustic Strike &amp; Unairu Wisp</td><td style="text-align:center;">NOTES</td><td style="text-align:center;">Amp Spike</td><td style="text-align:center;">N/A</td></tr><tr><td style="text-align:center;">Orange Headshot</td><td style="text-align:center;">3,523,459(3x = 10,570,377)</td><td style="text-align:center;">13,274,427 (3x = 39,823,281)</td><td style="text-align:center;">1,463,254 (3x = 4,389,762)</td><td style="text-align:center;">949,831 (3x = 2,849,493)</td><td style="text-align:center;">1,463,254 (3x = 4,389,762)</td><td style="text-align:center;">949,831 (3x = 2,849,493)</td></tr><tr><td style="text-align:center;">Yellow Headshot</td><td style="text-align:center;">1,867,671 (3x = 5,603,013)</td><td style="text-align:center;">7,036,341 (3x = 21,109,023)</td><td style="text-align:center;">825,250 (3x = 2,475,750)</td><td style="text-align:center;">535,689 (3x = 1,607,067)</td><td style="text-align:center;">825,250 (3x = 2,475,750)</td><td style="text-align:center;">535,689 (3x = 1,607,067)</td></tr></tbody></table></div><div class="info custom-block"><p class="custom-block-title"><strong>Rahn Notes:</strong></p><p>Projectile, automatic, long range</p></div><p>Focus School Notes:</p><ul><li>Contamination Wave: Distilled Contamination will increase damage on nearby targets.</li><li>Void Strike: Damage varies depending on how much energy is available.</li><li>Caustic Strike &amp; Unairu Wisp: Multiple Caustic Strike casts will give Unairu Wisps to nearby teammates.</li><li>Temportal Drag &amp; Temporal Shot: Temporal Drag can no longer be applied to Spectral forms (RIP).</li><li>Amp Spike: Amp Spike requires at least 8x combo multiplier.</li><li>N/A (Vazarin): Vazarin has no way of increasing its Amp damage.</li></ul>',28)]))}const y=e(d,[["render",c]]);export{u as __pageData,y as default};
